description:
Weerstation Driehuis NH is een typisch “stadsweerstation” en staat in de bebouwde kom van het dorpje Driehuis (gemeente Velsen) in Noord-Holland. De afstand tot de duinen aan de westzijde van het dorp bedraagt circa 250m en Driehuis is op circa 5km van de Noordzee gelegen. De hoogte van deze locatie bedraagt 7m boven NAP en de grondsoort is duinzand.
Het weerstation is in 2008 gestart en de gegevens van de sensoren worden verzameld en vastgelegd door een Oregon Scientific WMR200 weerstation.

Het station publiceert de date van de volgende sensoren:
=> Barometer (Luchtdruk meting door WMR-200 console welke binnen staat opgesteld);
=>Thermometer-buiten (Temperatuur meting per 60sec op ca 1,7m hoogte in de tuin aan de westzijde, vrij in de wind, in een Mierij Meteo weerhut);
=> Hygrometer-buiten (Luchtvochtigheid meting per 60sec op ca 1,7m hoogte in de tuin aan de westzijde, vrij in de wind, in een Mierij Meteo weerhut);
=> Anemometer (Windsnelheid en -richting per 14sec op ca 6m hoogte in de tuin aan de westzijde. De windmeting voldoet nog niet aan de normen en teveel tussen bebouwing. Er zijn plannen om de Anemometer op 10m hoogte aan te brengen, waardoor deze vrijwel volledig vrij in de wind staat);
=> Regenmeter (Neerslag meting per 60sec op ca 2,5m hoogte in de tuin aan de westzijde, vrij gelegen van bebouwing en beplanting);
=> UV-meter (Zonkracht meting per 73sec op ca 4m hoogte in de tuin aan de westzijde, volledig in de zon).

De weerdata van de Oregon Scientific WMR200 worden continu vastgelegd via Meteohub (= Raspberry Pi B voorzien van Meteohub-software). De Meteohub upload iedere 5 minuten de actuele weerdata
